import React from 'react';
import { Navbar, AboutMe, Skills, Experience, Projects,Certificates, ContactMe, TextAnimation } from './container/index.js';
import { Link } from 'react-scroll';

function App() {
  return (
    <div>
      <Navbar spy={true} smooth={true} duration={500}/>
    { /*  <TextAnimation /> */}
      <AboutMe spy={true} smooth={true} duration={500}/>
      <Skills spy={true} smooth={true} duration={500}/>
      <Experience spy={true} smooth={true} duration={500}/>
      {/*<Projects />*/}
      <Certificates spy={true} smooth={true} duration={500}/>
      <ContactMe spy={true} smooth={true} duration={500}/> 
    </div>
  );
}

export default App;
